#include <stdio.h>
#include <stdint.h>

uint64_t shuffle(uint64_t num){
	uint64_t buf=num;

	num = (num >> 41) | (num << 23);
	num += buf*131 + 13238717;

	return num;
}

int main() {
	uint64_t seed = 696942069699; 

	while(1){
		seed=shuffle(seed);
		fwrite(&seed, sizeof(uint64_t), 1, stdout);
	}

    return 0;
}

