vector<string> nums = {"1110111", "0010010", "1011101", "1011011", "0111010", "1101011", "1101111", "1010010", "1111111", "1111011"};

int get(string& s, int pos) {
    int cnt = 0;
    for (int i = 0; i < 7; ++i) {
        if (s[i] == '1' && nums[pos][i] == '0') {
            return -1;
        }
        if (s[i] != nums[pos][i]) {
            ++cnt;
        }
    }
    return cnt;
}

inline void solve() {
    int n, k;
    cin >> n >> k;
    vector<vector<pair<int, int>>> a(n);
    for (int i = 0; i < n; ++i) {
        string s;
        cin >> s;
        for (int j = 0; j < 10; ++j) {
            int cur = get(s, j);
            if (cur != -1) {
                a[i].emplace_back(cur, j);
            }
        }
    }

    vector<string> dp(k + 1, "@");
    dp[0] = string(n, '#');
    for (int i = 0; i < n; ++i) {
        for (auto [cost, num] : a[i]) {
            for (int j = k; j >= cost; --j) {
                if (dp[j - cost] != "@") {
                    string cur = dp[j - cost];
                    cur[i] = char(num + '0');
                    if (dp[j] == "@" || dp[j] < cur) {
                        dp[j] = cur;
                    }
                }
            }
        }
    }

    if (dp[k].find('#') == string::npos) {
        cout << dp[k] << '\n';
    } else {
        cout << -1 << '\n';
    }
}

