const remapObject = <T, Y>(remapSchema: RemapSchema, input: T): Y => {
    const result: Record<string, any> = {};

    for (const key in remapSchema) {
        if ((input as any)[key]) {
            result[remapSchema[key]] = (input as any)[key];
        }
    }

    return result as Y;
