//funkciq za namirane na broqt na delitelite
int br_deliteli(int n)
{
    int result = 1;
    for (int i = 2; i * i <= n; ++i)
    {
        int br = 0;
        while (n % i == 0)
        {
            n /= i;
            br++;
        }
        result *= (br + 1);
    }
    if (n > 1)
    {
        result *= 2;
    }
    return result;
}

